_Bool is_numbers(Str str){
    _Bool hit_point = 0;
    if(str.length <1){
        return 0;
    }
    int start = 0;
    if(str.items[0] == '-'){
        start = 1;
    }
    for(size_t i= start; i<str.length; i++){
        if(!is_number(str.items[i]) && !(str.items[i] == '-')){
            if(!hit_point){
                if(str.items[i] == '.'){
                    hit_point = 1;
                } else{
                    return 0;
                }
            } else{
                return 0;
            }
        }
    }
    return 1;
}


